import React from 'react';

const HomePage = () => {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>Hasaki Beauty Store</h1>
        <p style={styles.subtitle}>Welcome to Hasaki Beauty Store! Explore our collection of premium beauty products.</p>
      </header>
      <section style={styles.featuredProducts}>
        <h2>Featured Products</h2>
        <div style={styles.product}>
          <img src="product1.jpg" alt="Product 1" style={styles.productImage} />
          <h3 style={styles.productTitle}>Product 1</h3>
          <p style={styles.productDescription}>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          <button style={styles.productButton}>View Details</button>
        </div>
        <div style={styles.product}>
          <img src="product2.jpg" alt="Product 2" style={styles.productImage} />
          <h3 style={styles.productTitle}>Product 2</h3>
          <p style={styles.productDescription}>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
          <button style={styles.productButton}>View Details</button>
        </div>
        {/* Add more featured products here */}
      </section>
      <section style={styles.aboutUs}>
        <h2>About Us</h2>
        <p>We strive to provide the best beauty products for our customers. Our products are carefully curated to enhance your natural beauty.</p>
      </section>
      {/* Add more UI elements here */}
    </div>
  );
}

const styles = {
  container: {
    maxWidth: '800px',
    margin: '0 auto',
    padding: '20px',
  },
  header: {
    textAlign: 'center',
    marginBottom: '40px',
  },
  title: {
    fontSize: '2.5rem',
    color: '#333',
  },
  subtitle: {
    fontSize: '1.2rem',
    color: '#666',
  },
  featuredProducts: {
    marginBottom: '40px',
  },
  product: {
    marginBottom: '20px',
    border: '1px solid #ddd',
    borderRadius: '5px',
    padding: '10px',
  },
  productImage: {
    width: '100%',
    borderRadius: '5px',
  },
  productTitle: {
    fontSize: '1.2rem',
    marginTop: '10px',
    marginBottom: '5px',
  },
  productDescription: {
    fontSize: '1rem',
    color: '#666',
  },
  productButton: {
    backgroundColor: '#326e51',
    color: '#fff',
    border: 'none',
    padding: '8px 16px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginTop: '10px',
  },
  aboutUs: {
    marginBottom: '40px',
  },
  // Add more CSS styles here if needed
};

export default HomePage;
